import React, { Fragment } from 'react';
import {Row,Container,Col} from 'react-bootstrap';
const Home=()=>{
    return(
    <Fragment>
        <h1 style={{textAlign:'center'}}>Tours</h1>
        <Container>
      <Row>
        <Col>1 of 2</Col>
        <Col>2 of 2</Col>
      </Row>
      <Row>
        <Col>1 of 3</Col>
        <Col>2 of 3</Col>
        <Col>3 of 3</Col>
      </Row>
    </Container>
    </Fragment>
    )
}
export default Home;
